CREATE TABLE `equipment_schedules` (
  `id` int NOT NULL AUTO_INCREMENT,
  `equipment_id` int NOT NULL,
  `start_time` datetime NOT NULL,
  `end_time` datetime NOT NULL,
  `work_order_id` int DEFAULT NULL,
  `task_id` int DEFAULT NULL,
  `operator_id` int DEFAULT NULL,
  `title` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `notes` text COLLATE utf8mb4_unicode_ci,
  `status` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `equipment_id` (`equipment_id`),
  KEY `work_order_id` (`work_order_id`),
  KEY `task_id` (`task_id`),
  KEY `operator_id` (`operator_id`),
  KEY `ix_equipment_schedules_start_time` (`start_time`),
  KEY `ix_equipment_schedules_end_time` (`end_time`),
  KEY `ix_equipment_schedules_id` (`id`),
  CONSTRAINT `equipment_schedules_ibfk_1` FOREIGN KEY (`equipment_id`) REFERENCES `equipment` (`id`),
  CONSTRAINT `equipment_schedules_ibfk_2` FOREIGN KEY (`work_order_id`) REFERENCES `work_orders` (`id`),
  CONSTRAINT `equipment_schedules_ibfk_3` FOREIGN KEY (`task_id`) REFERENCES `work_order_tasks` (`id`),
  CONSTRAINT `equipment_schedules_ibfk_4` FOREIGN KEY (`operator_id`) REFERENCES `personnel` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=489 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
