--
-- Table structure for table `work_orders`
--

DROP TABLE IF EXISTS `work_orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `work_orders` (
  `id` int NOT NULL AUTO_INCREMENT,
  `order_number` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `title` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci,
  `work_order_type` enum('FAILURE_ANALYSIS','RELIABILITY_TEST') COLLATE utf8mb4_unicode_ci NOT NULL,
  `laboratory_id` int NOT NULL,
  `site_id` int NOT NULL,
  `client_id` int DEFAULT NULL,
  `testing_source` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sla_deadline` datetime DEFAULT NULL,
  `priority_score` float DEFAULT NULL,
  `priority_level` int DEFAULT NULL,
  `assigned_engineer_id` int DEFAULT NULL,
  `status` enum('DRAFT','PENDING','ASSIGNED','IN_PROGRESS','ON_HOLD','REVIEW','COMPLETED','CANCELLED') COLLATE utf8mb4_unicode_ci NOT NULL,
  `standard_cycle_hours` float DEFAULT NULL,
  `actual_cycle_hours` float DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `assigned_at` datetime DEFAULT NULL,
  `started_at` datetime DEFAULT NULL,
  `completed_at` datetime DEFAULT NULL,
  `created_by_id` int NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ix_work_orders_order_number` (`order_number`),
  KEY `laboratory_id` (`laboratory_id`),
  KEY `site_id` (`site_id`),
  KEY `client_id` (`client_id`),
  KEY `assigned_engineer_id` (`assigned_engineer_id`),
  KEY `created_by_id` (`created_by_id`),
  KEY `ix_work_orders_id` (`id`),
  KEY `ix_work_orders_work_order_type` (`work_order_type`),
  KEY `ix_work_orders_status` (`status`),
  CONSTRAINT `work_orders_ibfk_1` FOREIGN KEY (`laboratory_id`) REFERENCES `laboratories` (`id`),
  CONSTRAINT `work_orders_ibfk_2` FOREIGN KEY (`site_id`) REFERENCES `sites` (`id`),
  CONSTRAINT `work_orders_ibfk_3` FOREIGN KEY (`client_id`) REFERENCES `clients` (`id`),
  CONSTRAINT `work_orders_ibfk_4` FOREIGN KEY (`assigned_engineer_id`) REFERENCES `personnel` (`id`),
  CONSTRAINT `work_orders_ibfk_5` FOREIGN KEY (`created_by_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
